import React, { useState, useEffect } from 'react';
import axios from 'axios';

function SessionInitialization() {
    // State variables for user inputs
    const [studyId, setStudyId] = useState(localStorage.getItem('studyId') || "");
    const [sessionId, setSessionId] = useState(localStorage.getItem('sessionId') || "");
    const [participantId, setParticipantId] = useState(localStorage.getItem('participantId') || "");
    const [name, setName] = useState(localStorage.getItem('name') || "");
    const [smartphoneIp, setSmartphoneIp] = useState(localStorage.getItem('smartphoneIp') || "192.168.4.245");
    
    // Derived values for the backend
    const [savePath, setSavePath] = useState("");
    const [videoNamePrefix, setVideoNamePrefix] = useState("");

    // UI state
    const [isStarting, setIsStarting] = useState(false);
    const [message, setMessage] = useState("");

    // Use a useEffect hook to update the derived values and localStorage
    useEffect(() => {
        // Construct the save path based on studyId and sessionId
        if (studyId && sessionId) {
            setSavePath(`data/${studyId}/${sessionId}`);
            setVideoNamePrefix(`${participantId}_${name}`);
        } else {
            setSavePath("data");
            setVideoNamePrefix("");
        }

        // Save values to localStorage for persistence
        localStorage.setItem('studyId', studyId);
        localStorage.setItem('sessionId', sessionId);
        localStorage.setItem('participantId', participantId);
        localStorage.setItem('name', name);
        localStorage.setItem('smartphoneIp', smartphoneIp);
    }, [studyId, sessionId, participantId, name, smartphoneIp]);

    const handleStartRecording = async () => {
        if (!studyId || !sessionId || !participantId) {
            alert("Please enter Study ID, Session ID, and Participant ID.");
            return;
        }

        setIsStarting(true);
        setMessage("Starting a new recording session...");

        const requestBody = {
            session_id: sessionId,
            name: videoNamePrefix,
            save_path: savePath,
            // The smartphone IP is set in the backend, but we can display it here for user confirmation.
        };

        try {
            const response = await axios.post("http://localhost:8000/start-recording", requestBody);
            setMessage(`Session started successfully! Session ID: ${response.data.session_id}`);
            console.log("Session started:", response.data);
        } catch (error) {
            console.error("Failed to start session:", error);
            setMessage(`Failed to start session. Error: ${error.response?.data?.detail || error.message}`);
        } finally {
            setIsStarting(false);
        }
    };

    return (
        <div style={{ padding: "2rem", maxWidth: "800px", margin: "0 auto" }}>
            <h2>Session Initialization</h2>
            <p>Enter the details to start a new recording session on the smartphone.</p>

            <h3 style={{ marginTop: "2rem" }}>Session Details</h3>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="study-id">Study ID:</label>
                <input
                    type="text"
                    id="study-id"
                    value={studyId}
                    onChange={(e) => setStudyId(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., Study_ABC"
                />
            </div>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="participant-id">Participant ID:</label>
                <input
                    type="text"
                    id="participant-id"
                    value={participantId}
                    onChange={(e) => setParticipantId(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., P01"
                />
            </div>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="session-id">Session ID:</label>
                <input
                    type="text"
                    id="session-id"
                    value={sessionId}
                    onChange={(e) => setSessionId(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., session_1_day_1"
                />
            </div>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="name">Video Name Prefix:</label>
                <input
                    type="text"
                    id="name"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., baseline_trial"
                />
            </div>
            <div style={{ marginBottom: "1rem" }}>
                <label htmlFor="smartphone-ip">Smartphone IP:</label>
                <input
                    type="text"
                    id="smartphone-ip"
                    value={smartphoneIp}
                    onChange={(e) => setSmartphoneIp(e.target.value)}
                    style={{ marginLeft: "0.5rem", padding: "8px" }}
                    placeholder="e.g., 192.168.1.100"
                />
            </div>

            <h3 style={{ marginTop: "2.5rem" }}>Start Recording Session</h3>
            <div style={{ marginBottom: "1rem" }}>
                <p><strong>Derived Save Path:</strong> <code>{savePath}</code></p>
                <p><strong>Derived Video Name Prefix:</strong> <code>{videoNamePrefix}</code></p>
            </div>
            <button
                onClick={handleStartRecording}
                disabled={isStarting || !studyId || !sessionId || !participantId}
                style={{ padding: "10px 20px", fontSize: "1rem" }}
            >
                {isStarting ? "Starting Session..." : "Start Session"}
            </button>
            {message && <p style={{ marginTop: "1rem", color: isStarting ? 'orange' : (message.includes("Failed") ? 'red' : 'green') }}>{message}</p>}
        </div>
    );
}

export default SessionInitialization;
